           searchKey: '',
           searchAugments: []
      };

      this.searchBoxChange=this.searchBoxChange.bind(this);
      this.augmentClick=this.augmentClick.bind(this);
      this.closeAllLists=this.closeAllLists.bind(this);
    }

    componentDidMount(){
      this.props.loadObjectsArray();
    }

    augmentClick(str, e){
      this.setState({searchKey: str, searchAugments: []})
    }

    closeAllLists(e){

    }

  searchBoxChange(e){
    const countriesFiltered=e.target.value!==''?this.state.countries.filter((val)=>val.toUpperCase().startsWith(e.target.value.toUpperCase())):[];
    this.setState({searchKey: e.target.value, searchAugments: countriesFiltered});
    //const quizesFiltered=e.target.value!==''?this.props.objectsArray.filter((val)=>val.description.toUpperCase().startsWith(e.target.value.toUpperCase())):[];

  }

  render(){
    const visibilityClassName=this.props.show
    ? "simple-dialog-overlay simple-dialog-display-block"
    : "simple-dialog-overlay simple-dialog-display-none";

    if(this.state.searchAugments.length===0&&this.props.objectsArray!==undefined&&this.props.objectsArray.length>0){
          console.log(this.props.objectsArray);
    }


    return (
        <div className={visibilityClassName}>
        <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"/>
           <div className="add-to-dialog" id="AddToDialog">
               <button id = "x" onClick={this.props.handleDismiss}>
                X
               </button>
               <h2>{this.props.titleMessage}</h2>
               <hr class="rounded"/>
               <div className="autocomplete" onClick={(e)=>this.closeAllLists(e)}>
                  <input id="searchBox" type="text" name="searchBox"
                  value={this.state.searchKey}
                  onChange={this.searchBoxChange} placeholder="search key"/>
                  <div className="autocomplete-items">
                  {
                    this.state.searchAugments.map(str=>(<div onClick={(e)=>this.augmentClick(str, e)}><strong>{str.substring(0,this.state.searchKey.length)}</strong>{str.substring(this.state.searchKey.length)}</div>))
                  }
                  </div>
               </div>
               <input type="submit" value={this.props.submitMessage}/>
            </div>
        </div>
    )
  }
}

export default AddToDialog;
